import React from 'react'
import './footer.css'

import {Link} from 'react-router-dom';
import {Container, Row,Col, ListGroup, ListGroupItem} from 'reactstrap'
import logo from '../../assets/images/logo.png'

const quick__links=[
  {
    path:'/home',
    display:'Home'
  },
  {
    path:'/about',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  },
];

const nav__links=[
  {
    path:'/home',
    display:'Home'
  },
  {
    path:'/about',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  },
]
const Footer = () => {
  return (
    <div>Footer</div>
  )
}

export default Footer
